import React from "react";
import styles from './style.module.css'

export default function Recipe ({name, img, description}){
    return (
        <>
        <div>
           <img className={styles.image} alt="" src={img}></img>
           <p>{name}</p>
           <h5>{description}</h5>
        </div>
        </>
    )
}
